                <input type="search" required name = "search" value = {search} onChange={handleSearch} placeholder = "Search event by category"/>

            </form>









      {user && !user?.admin ? <h1>Home customer</h1> : ''}
       { user?.admin ? <h1>Home organizer </h1> : ''}
        </div>
    )
}
